package com.jty.model;import java.io.Serializable;import java.util.Date;import javax.persistence.Entity;import javax.persistence.Id;@SuppressWarnings("serial")@Entity(name = "fundaccount")public class FundAccount implements Serializable {    @Id	private Long id;    private Long userId;    private Double returnAmount;    private Long fromUserId;    private Long orderId;    private Integer agentLevel;    private Float returnRatio;    private Integer isCheck;    private Integer type;    private Date createTime;    private Date lastUpdateTime;	public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}	public Long getUserId() {		return userId;	}	public void setUserId(Long userId) {		this.userId = userId;	}	public Double getReturnAmount() {		return returnAmount;	}	public void setReturnAmount(Double returnAmount) {		this.returnAmount = returnAmount;	}	public Long getFromUserId() {		return fromUserId;	}	public void setFromUserId(Long fromUserId) {		this.fromUserId = fromUserId;	}	public Long getOrderId() {		return orderId;	}	public void setOrderId(Long orderId) {		this.orderId = orderId;	}	public Integer getAgentLevel() {		return agentLevel;	}	public void setAgentLevel(Integer agentLevel) {		this.agentLevel = agentLevel;	}	public Float getReturnRatio() {		return returnRatio;	}	public void setReturnRatio(Float returnRatio) {		this.returnRatio = returnRatio;	}	public Integer getIsCheck() {		return isCheck;	}	public void setIsCheck(Integer isCheck) {		this.isCheck = isCheck;	}	public Integer getType() {		return type;	}	public void setType(Integer type) {		this.type = type;	}	public Date getCreateTime() {		return createTime;	}	public void setCreateTime(Date createTime) {		this.createTime = createTime;	}	public Date getLastUpdateTime() {		return lastUpdateTime;	}	public void setLastUpdateTime(Date lastUpdateTime) {		this.lastUpdateTime = lastUpdateTime;	}}